import { useState } from "react";
import Navbar from "../../components/Navbar";
import AdminPanel from "../../components/AdminPanel";
import Footer from "../../components/Footer";
import UserForm from "./UserForm";

const RegisterUser = () => {
  const [message, setMessage] = useState("");
  const [checkMaster, setCheckMaster] = useState(null);
  const [authorizedUser, setAuthorizedUser] = useState(null);

  return (
    <>
    <>
      <Navbar />
      <main>
        <AdminPanel />
        <p className="message">{message}</p>
        <section className="p-[4rem] grid justify-center items-center">
          <h1 className="title">Register User</h1>
          <form action="/admin/register" method="POST" className="flex flex-col justify-center items-center w-[90vw]">
            <UserForm
              checkMaster={checkMaster}
              authorizedUser={authorizedUser}
            />
          </form>
        </section>
      </main>
      <Footer />
    </>
    </>
  );
};

export default RegisterUser;
